import React, { Component } from "react";
import {Rate} from "antd";
import Button from "antd/es/button";
import Avatar from "antd/es/avatar";
import UserOutlined from "@ant-design/icons/lib/icons/UserOutlined";
import MailOutlined from "@ant-design/icons/lib/icons/MailOutlined";
import WhatsAppOutlined from "@ant-design/icons/lib/icons/WhatsAppOutlined";
import Divider from "antd/es/divider";
import EditOutlined from "@ant-design/icons/lib/icons/EditOutlined";

class StudentProfileManagerComponent extends Component {
    render() {
        return (
            <div className="student-profile-container">
                <div className="profile-detail-head">
                    <div className="profile-detail-head-wrapper" >
                        <div className="profile-detail-head-title">
                            <Avatar  size={120} icon={<UserOutlined />}  className="project-img"/>
                            <div className="profile-title-right">
                                <div className="div-context"><h2>Junyu Lu</h2></div>
                                <div className="div-context email-div"><span className="email-phone"><MailOutlined /> &nbsp; jl9829@nyu.edu &nbsp; <WhatsAppOutlined /> +1 (646) 829 5132</span></div>
                                <div className="div-context"><EditOutlined /> edit your profile</div>

                            </div>
                        </div>
                        <div className="profile-edit">
                            <Button type="primary" shape="round" size="large">
                                Apply
                            </Button>
                        </div>
                        <div className="profile-clear"></div>
                        <div className="profile-body">
                            <Divider />
                            <div className="project-preference">
                                <div className="preference-header">

                                </div>
                            </div>
                        </div>

                    </div>
                </div>
            </div>
        );
    }
}

export default StudentProfileManagerComponent;
